import { Box, Link, Stack, styled, Typography } from "@mui/material";
//import axios from "axios";
import { useEffect, useState } from "react";

import Breakfast from "../../static/breakfast.jpg";
import Dinner from "../../static/dinner.jpg";
import Salad from "../../static/salad.jpg";
import Holiday from "../../static/holiday.jpg";
import Vegetarian from "../../static/vegetarian.jpg";
import Dessert from "../../static/dessert.jpg";

const Category = () => {
  const [cat, setCat] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        //const res = await axios.get(`${process.env.REACT_APP_API_URL}/api/category/`);
        const res = [
          {"id":1,"name":"Breakfast","image":{chef}},
          {"id":2,"name":"Dinner","image":"./src/static/categories/dinner.jpg"},
          {"id":3,"name":"Salad","image":"/media/image/categories/salad.jpg"},
          {"id":4,"name":"Holiday","image":"/media/image/categories/holiday.jpg"},
          {"id":5,"name":"Vegetarian","image":"/media/image/categories/vegetarian.jpg"},
          {"id":6,"name":"Dessert","image":"/media/image/categories/dessert.jpg"}
        ]
        setCat(res);
      } catch (error) {
        console.log(error);
      }
    };
    fetchData();
  }, []);

  const StyledCard = styled(Box)(({ theme }) => ({
    display: "flex",
    justifyContent: "center",
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    backgroundSize: "cover",
    borderRadius: "100%",
    overflow: "hidden",
    width: "100px",
    cursor: "pointer",
    [theme.breakpoints.up("md")]: {
      height: 100,
    },
    [theme.breakpoints.down("md")]: {
      height: 100,
    },
    "&:hover": {
      opacity: 0.8,
      boxSizing: "borderBox",
      zIndex: 1,
      transition: `all 0.45s ease`,
    },
  }));
  const StyledTypography = styled(Typography)({
    textAlign: "center",
    color: "black",
    fontSize: 20,
  });
  const CardBox = styled(Box)({
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    flexDirection: "column",
  });
  return (
    <Stack
      Container
      direction={"row"}
      mt={4}
      spacing={3}
      ml={3}
      sx={{ maxWidth: "100%", overflow: "auto" }}
    >
      <Link href="category/1" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: {Breakfast} }} />
            <StyledTypography>Breakfast</StyledTypography>
          </CardBox>
        </Link>
        <Link href="category/2" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: {Dinner} }} />
            <StyledTypography>Dinner</StyledTypography>
          </CardBox>
        </Link>
        <Link href="category/3" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: {Salad} }} />
            <StyledTypography>Salad</StyledTypography>
          </CardBox>
        </Link>
        <Link href="category/4" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: {Holiday} }} />
            <StyledTypography>Holiday</StyledTypography>
          </CardBox>
        </Link>
        <Link href="category/5" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: {Vegetarian} }} />
            <StyledTypography>Vegetarian</StyledTypography>
          </CardBox>
        </Link>
        <Link href="category/6" sx={{ textDecoration: "none" }}>
          <CardBox>
            <StyledCard sx={{ backgroundImage: {Dessert} }} />
            <StyledTypography>Dessert</StyledTypography>
          </CardBox>
        </Link>
    </Stack>
  );
};

export default Category;
